import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {
      id: 'e1',
      expenseDate: new Date(2021, 11, 7),
      expenseTitle: 'Car Insurance',
      expenseAmount: 294.8
    },
    {
      id: 'e2',
      expenseDate: new Date(2021, 11, 8),
      expenseTitle: 'Bike Insurance',
      expenseAmount: 294.8
    },
    {
      id: 'e3',
      expenseDate: new Date(2021, 11, 9),
      expenseTitle: 'Tractor Insurance',
      expenseAmount: 294.8
    },
    {
      id: 'e4',
      expenseDate: new Date(2021, 11, 10),
      expenseTitle: 'Cycle Insurance',
      expenseAmount: 294.8
    },
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
       date={expenses[0].expenseDate} 
       title={expenses[0].expenseTitle} 
       amount={expenses[0].expenseAmount}
       />

      <ExpenseItem 
      date={expenses[1].expenseDate} 
      title={expenses[1].expenseTitle} 
      amount={expenses[1].expenseAmount}
      />

      <ExpenseItem 
      date={expenses[2].expenseDate} 
      title={expenses[2].expenseTitle} 
      amount={expenses[2].expenseAmount}
      />

      <ExpenseItem 
      date={expenses[3].expenseDate} 
      title={expenses[3].expenseTitle} 
      amount={expenses[3].expenseAmount}
      />

    </div>
  );
}

export default App;
